const result = {
  revenue: 0,
  registeredUsers: 0,
  totalUsers: 0,
  adSpend: 0
};

for (const item of items) {
  if (item.json.sum_TotalAmount !== undefined) {
    result.revenue = item.json.sum_TotalAmount;
  }

  if (item.json.count_email !== undefined) {
    result.registeredUsers = item.json.count_email;
  }

  if (item.json["Total Users"] !== undefined) {
    result.totalUsers = item.json["Total Users"];
  }

  if (item.json.sum_Ad_Spend !== undefined) {
    result.adSpend = item.json.sum_Ad_Spend;
  }
}

return [{ json: result }];

const revenue = Number($json.revenue) || 0;
const adSpend = Number($json.adSpend) || 0;
const users = Number($json.registeredUsers) || 0;

// Optional: yesterday values (if available later)
const yesterdayRevenue = Number($json.yesterdayRevenue) || 0;
const yesterdayUsers = Number($json.yesterdayUsers) || 0;

// KPI calculations
const ROAS = adSpend > 0 ? revenue / adSpend : 0;
const CAC = users > 0 ? adSpend / users : 0;

// Growth calculations
const revenueGrowthPct =
  yesterdayRevenue > 0
    ? ((revenue - yesterdayRevenue) / yesterdayRevenue) * 100
    : 0;

const userGrowthPct =
  yesterdayUsers > 0
    ? ((users - yesterdayUsers) / yesterdayUsers) * 100
    : 0;

return [
  {
    json: {
      ...$json,
      ROAS: Number(ROAS.toFixed(2)),
      CAC: Number(CAC.toFixed(2)),
      //revenueGrowthPct: Number(revenueGrowthPct.toFixed(2)),
      //userGrowthPct: Number(userGrowthPct.toFixed(2))
    }
  }
];

const kpi = $json;

let status = "normal";
let priority = "low";
let insights = [];

if(kpi.ROAS < 1){
  status = "risk";
  priority = "high";
  insights.push("Marketing spend is not generating returns");
}

if(kpi.ROAS >= 3){
  insights.push("Marketing campaigns are perfoming very well");
}

if(kpi.CAC > 100){
  status = "risk";
  priority = "medium";
  insights.push("Customer acquision cost is high");
}

return [{
  json: {
    ...kpi,
    agentStatus: status,
    agentPriority: priority,
    insights
  }
}];

